import React from "react";
import WorldWide from "./Total";
import Country from "./Country";

function App() {
  return (
      <div className="App">'
        <h3>#Made using <a href="https://covid19.mathdro.id/api/">covid19.mathdro.id/api</a></h3>
        <Country />
        <WorldWide />
      </div>
  );
}

export default App;
